import React from 'react';
import { useAuthContext } from '../../context/auth/AuthContextProvider';

const UserInfo = () => {
  const { state } = useAuthContext();
  const { user } = state;

  return (
    <div>
      <section>
        <p>{user.userName}</p>
        <p>{user.email}</p>
        <p>{user.iet}</p>
        <p>{user.exp}</p>
        <p></p>
      </section>
    </div>
  );
};

export default UserInfo;
